import { Link } from "react-router-dom";
import bannerImage from "../../images/banner1.jpg";
import styles from "./Banner.module.css";

const Banner = () => {
  return (
    <>
      <div
        className={`d-sm-block d-none ${styles["banner-image"]}`}
        style={{
          backgroundImage: `url(${bannerImage})`,
          backgroundSize: "cover",
        }}
      >
        <div className={`container py-4 ${styles["banner-image"]}`}>
          <div className={`d-flex flex-column mt-5 ms-5 ${styles["banner"]}`}>
            <h3 className="mt-5 ms-5">New Inspiration 2020</h3>
            <p className="mt-1 ms-5">20% off on new season</p>
            <Link to="/shop" className="ms-5 py-2 px-4">
              Browse collections
            </Link>
          </div>
        </div>
      </div>
    </>
  );
};

export default Banner;
